import React from 'react'
import './Tile.css' 
export default function Tile(props) {
    var tiles = []
    var counter = 0;
    props.tileArr.forEach(element => {
        console.log(element)
        tiles.push([])
        element.forEach(letter => {
            tiles[counter].push(<div className='singleTile'>{letter}</div>)
        })
        counter++;
    });
    console.log(tiles)

  return (
    <>
    <div>{props.tileArr.map((row,index)=>(
        <div>
        {row.map((letter)=>(
            <div style={{backgroundColor:'#b58a64'}}>{letter}</div>
        ))}
        </div>
    ))}</div>
    {/* <div className='wholePiece'>{tiles}</div> */}
    </>
  )
}
